INSERT INTO `rainlab_blog_posts` VALUES (1,NULL,'内蒙古博顺和德精密制造有限公司顺利投产','first-blog-post','2017年8月1日，广州和德携手中电博顺智能设备技术有限公司合资创立的内蒙古博顺和德精密制造有限公司顺利建成投产','<p>2017年8月1日，广州和德携手中电博顺智能设备技术有限公司合资创立的内蒙古博顺和德精密制造有限公司顺利建成投产。内蒙古博顺和德精密制造有限公司总投资预算逾1.8亿元，第一期投资3200万元。全面投产后产能将达3000吨以上，主要生产高铁、光伏、军工及汽车等领域的高强度、耐疲劳的精密液态模锻轻量化产品。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"/storage/app/media/1.png\" />&nbsp;</p>\r\n\r\n<p>内蒙古博顺和德精密制造有限公司大门</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"/storage/app/media/2.png\" />&nbsp;</p>\r\n\r\n<p>内蒙古博顺和德精密制造有限公司车间</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"/storage/app/media/3.png\" />&nbsp;</p>\r\n\r\n<p>内蒙古博顺和德精密制造有限公司检验室一角</p>','<p>2017年8月1日，广州和德携手中电博顺智能设备技术有限公司合资创立的内蒙古博顺和德精密制造有限公司顺利建成投产。内蒙古博顺和德精密制造有限公司总投资预算逾1.8亿元，第一期投资3200万元。全面投产后产能将达3000吨以上，主要生产高铁、光伏、军工及汽车等领域的高强度、耐疲劳的精密液态模锻轻量化产品。</p>\n<p> </p>\n<p><img src=\"/storage/app/media/1.png\"> </p>\n<p>内蒙古博顺和德精密制造有限公司大门</p>\n<p> </p>\n<p><img src=\"/storage/app/media/2.png\"> </p>\n<p>内蒙古博顺和德精密制造有限公司车间</p>\n<p> </p>\n<p><img src=\"/storage/app/media/3.png\"> </p>\n<p>内蒙古博顺和德精密制造有限公司检验室一角</p>','2018-04-28 06:02:55',1,'2018-04-28 06:03:05','2018-04-30 08:58:28'),(2,1,'气囊支臂','qinangzhibi','','<p>气囊悬挂是一种<a href=\"https://baike.baidu.com/item/%E5%87%8F%E9%9C%87%E5%99%A8\" target=\"_blank\">减震器</a>，依靠一个强力气泵为每个气室充气，在客车和轻卡上常用，行程较短。</p>\r\n\r\n<p>但舒适度好，载重能力强。可独立使用在越野车的后桥上，取代原来的钢板和减震器，增加支臂即可.</p>','<p>气囊悬挂是一种<a href=\"https://baike.baidu.com/item/%E5%87%8F%E9%9C%87%E5%99%A8\" target=\"_blank\">减震器</a>，依靠一个强力气泵为每个气室充气，在客车和轻卡上常用，行程较短。</p>\n<p>但舒适度好，载重能力强。可独立使用在越野车的后桥上，取代原来的钢板和减震器，增加支臂即可.</p>','2018-04-29 00:43:36',1,'2018-04-29 00:41:45','2018-04-30 20:39:22'),(3,1,'转向节','zhuanxiangjie','','<p>转向节（Steering Knuckle）又称&ldquo;羊角&rdquo;，是汽车转向桥中的重要零件之一，能够使汽车稳定行驶并灵敏传递行驶方向。</p>\r\n\r\n<p>转向节的功用是传递并承受汽车前部载荷，支承并带动前轮绕主销转动而使汽车转向。在汽车行驶状态下，它承受着多变的冲击载荷，因此，要求其具有很高的强度</p>','<p>转向节（Steering Knuckle）又称“羊角”，是汽车转向桥中的重要零件之一，能够使汽车稳定行驶并灵敏传递行驶方向。</p>\n<p>转向节的功用是传递并承受汽车前部载荷，支承并带动前轮绕主销转动而使汽车转向。在汽车行驶状态下，它承受着多变的冲击载荷，因此，要求其具有很高的强度</p>','2018-04-30 16:05:00',1,'2018-04-30 20:29:31','2018-04-30 20:31:23'),(4,1,'控制臂','kongzhibi','','<p>控制臂作为汽车悬架系统的导向和传力元件，将作用在车轮上的各种力传递给车身，同时保证车轮按一定轨迹运动。控制臂分别通过球铰或者衬套把车轮和车身弹性地连接在一起。控制臂( 包括与之相连的衬套及球头)应有足够的刚度、强度和使用寿命。</p>\r\n\r\n<p>\r\n<audio controls=\"controls\" style=\"display: none;\">&nbsp;</audio>\r\n</p>','<p>控制臂作为汽车悬架系统的导向和传力元件，将作用在车轮上的各种力传递给车身，同时保证车轮按一定轨迹运动。控制臂分别通过球铰或者衬套把车轮和车身弹性地连接在一起。控制臂( 包括与之相连的衬套及球头)应有足够的刚度、强度和使用寿命。</p>\n<p>\n<audio controls=\"controls\" style=\"display: none;\"> </audio>\n</p>','2018-04-30 18:05:00',1,'2018-04-30 20:33:04','2018-04-30 20:33:20'),(5,1,'悬置支架','zhijia','','<p>悬置是用于减少并控制发动机振动的传递，并起到支承作用的汽车动力总成件，应用于当前汽车工业中，广泛使用的悬置分为传统的纯胶悬置，以及动、静态性能较好的液压悬置。</p>','<p>悬置是用于减少并控制发动机振动的传递，并起到支承作用的汽车动力总成件，应用于当前汽车工业中，广泛使用的悬置分为传统的纯胶悬置，以及动、静态性能较好的液压悬置。</p>','2018-04-30 21:05:00',1,'2018-04-30 20:34:12','2018-04-30 20:34:58'),(6,1,'车把管','chebaguan','','<p>把立是<em>把把</em>横(也就是<em>车把</em>)连接到前叉上管上的那部分 立管是一般车架两个三角共用的那一部分 车架安装前叉的地方是头管,头管里压入腕组轴承</p>','<p>把立是<em>把把</em>横(也就是<em>车把</em>)连接到前叉上管上的那部分 立管是一般车架两个三角共用的那一部分 车架安装前叉的地方是头管,头管里压入腕组轴承</p>','2018-05-01 06:05:00',1,'2018-04-30 20:41:16','2018-04-30 20:41:16'),(7,1,'接触电网挂件','dianwangguajian','','<p><a href=\"https://baike.baidu.com/item/%E7%94%B5%E5%8A%9B/1250605\" target=\"_blank\">电力</a>系统中各种<a href=\"https://baike.baidu.com/item/%E7%94%B5%E5%8E%8B\" target=\"_blank\">电压</a>的变电所及输配电线路组成的整体，称为电力网。它包含<a href=\"https://baike.baidu.com/item/%E5%8F%98%E7%94%B5\" target=\"_blank\">变电</a>、<a href=\"https://baike.baidu.com/item/%E8%BE%93%E7%94%B5\" target=\"_blank\">输电</a>、<a href=\"https://baike.baidu.com/item/%E9%85%8D%E7%94%B5\" target=\"_blank\">配电</a>三个单元。电力网的任务是输送与分配电能，改变电压。</p>','<p><a href=\"https://baike.baidu.com/item/%E7%94%B5%E5%8A%9B/1250605\" target=\"_blank\">电力</a>系统中各种<a href=\"https://baike.baidu.com/item/%E7%94%B5%E5%8E%8B\" target=\"_blank\">电压</a>的变电所及输配电线路组成的整体，称为电力网。它包含<a href=\"https://baike.baidu.com/item/%E5%8F%98%E7%94%B5\" target=\"_blank\">变电</a>、<a href=\"https://baike.baidu.com/item/%E8%BE%93%E7%94%B5\" target=\"_blank\">输电</a>、<a href=\"https://baike.baidu.com/item/%E9%85%8D%E7%94%B5\" target=\"_blank\">配电</a>三个单元。电力网的任务是输送与分配电能，改变电压。</p>','2018-04-27 02:55:00',1,'2018-04-30 20:55:21','2018-04-30 20:55:21'),(8,1,'电动自行车马达座','madazuo','','<p><em>电动自行车</em>，是指以蓄电池作为辅助能源在普通<em>自行车</em>的基础上，安装了电机、控制器、蓄电池、转把闸把等操纵部件和显示仪表系统的机电一体化的个人交通工具。</p>','<p><em>电动自行车</em>，是指以蓄电池作为辅助能源在普通<em>自行车</em>的基础上，安装了电机、控制器、蓄电池、转把闸把等操纵部件和显示仪表系统的机电一体化的个人交通工具。</p>','2018-05-01 04:05:00',1,'2018-04-30 21:45:45','2018-04-30 21:45:45'),(9,1,'自行车减震杆','jianzhengan','','<p>软尾车的优势主要在于骑乘更加舒适，后轮贴地性更好更易于控制，能适合更加复杂的路况，但相比较硬尾而言，重量上比较大（软尾车进10kg不太容易，而硬尾车7－9kg的大有人在），以及踩踏有动力损失（现在的软尾车架已经把泄力这个问题解决的很好了，不过同样不包括那些民用软尾架，也就是随便装个弹簧就叫后避震的），而软尾架的后避震大致分为油气，气压，油气与弹簧相结合这几种型式，xc车架的后避震基本上是前两种，而am车架几种都存在，fr和dh车架基本上都是最后一种避震。</p>','<p>软尾车的优势主要在于骑乘更加舒适，后轮贴地性更好更易于控制，能适合更加复杂的路况，但相比较硬尾而言，重量上比较大（软尾车进10kg不太容易，而硬尾车7－9kg的大有人在），以及踩踏有动力损失（现在的软尾车架已经把泄力这个问题解决的很好了，不过同样不包括那些民用软尾架，也就是随便装个弹簧就叫后避震的），而软尾架的后避震大致分为油气，气压，油气与弹簧相结合这几种型式，xc车架的后避震基本上是前两种，而am车架几种都存在，fr和dh车架基本上都是最后一种避震。</p>','2018-04-30 19:05:00',1,'2018-04-30 21:48:43','2018-04-30 21:48:43'),(10,1,'轮椅支臂','lunyizhibi','','<p><em>轮椅</em>其他辅助件:是为了满足特殊患者的需要而设计,如增加手柄摩擦面,车匣延伸,防震装置,扶手安装臂托,或是方便患者吃饭、写字的<em>轮椅</em>桌等。</p>','<p><em>轮椅</em>其他辅助件:是为了满足特殊患者的需要而设计,如增加手柄摩擦面,车匣延伸,防震装置,扶手安装臂托,或是方便患者吃饭、写字的<em>轮椅</em>桌等。</p>','2018-05-01 04:07:00',1,'2018-04-30 21:51:12','2018-04-30 21:51:12'),(11,1,'基站支座','jizhanzhizuo','','<p>自立原理:便携式移动通信<em>基站</em>,其特征在于将塔体的基本节在铰接点通过 销轴安装座连接在框架的<em>支座</em>上,用螺栓连接好</p>','<p>自立原理:便携式移动通信<em>基站</em>,其特征在于将塔体的基本节在铰接点通过 销轴安装座连接在框架的<em>支座</em>上,用螺栓连接好</p>','2018-04-30 17:10:00',1,'2018-04-30 21:52:57','2018-04-30 21:53:09'),(12,1,'基站固定夹','jizhangudingjia','','<p>本实用新型公开了通信<em>基站</em>模块三综合试验夹持装置,包括:一作为夹持装置的基体的底座,一垂直<em>固定</em>于底座 上的中空的中心抱杆,还包括一位于中心抱杆上的外挂装置</p>','<p>本实用新型公开了通信<em>基站</em>模块三综合试验夹持装置,包括:一作为夹持装置的基体的底座,一垂直<em>固定</em>于底座 上的中空的中心抱杆,还包括一位于中心抱杆上的外挂装置</p>','2018-05-01 08:07:00',1,'2018-04-30 21:54:36','2018-04-30 21:54:36'),(13,1,'酒瓶底座','jiupingdizuo','','<p><em>酒瓶底座</em>是用来放置酒瓶并起到一定装饰作用的装置。现有的<em>酒瓶底座</em>包括底座主体,在底座主体上设置有用于放置酒瓶的区域。</p>','<p><em>酒瓶底座</em>是用来放置酒瓶并起到一定装饰作用的装置。现有的<em>酒瓶底座</em>包括底座主体,在底座主体上设置有用于放置酒瓶的区域。</p>','2018-05-01 05:05:00',1,'2018-04-30 21:56:42','2018-04-30 21:56:42'),(14,1,'光伏机器人组件','jiqirenzujian','','<p>该<em>机器人</em>采用无水清扫技术,即利用柔性硅胶刮片清扫<em>光伏组件</em>表面的浮尘,当遇到下雨天气时,可以启动<em>机器人</em>进行有水清洗。</p>','<p>该<em>机器人</em>采用无水清扫技术,即利用柔性硅胶刮片清扫<em>光伏组件</em>表面的浮尘,当遇到下雨天气时,可以启动<em>机器人</em>进行有水清洗。</p>','2018-05-01 06:00:00',1,'2018-04-30 21:59:03','2018-04-30 21:59:03'),(15,1,'公司参加第八届中国汽车技术展','qichejishuzhan','2018年第八届中国（重庆）汽车技术展•铝制品汽车零部件展在重庆国际博览中心于2018/3/28-30日隆重举行，国际汽车行业的知名企业和铝制汽车零部件精英聚集于此。','<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/81-0-0-0-0-1525174080.png\" /></p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/82-0-0-0-0-1525174096.png\" /></p>\r\n\r\n<p style=\"text-align:center\">2018年第八届中国（重庆）汽车技术展&bull;铝制品汽车零部件展在重庆国际博览中心于2018/3/28-30日隆重举行，国际汽车行业的知名企业和铝制汽车零部件精英聚集于此。</p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/83-0-0-0-0-1525174121.png\" /></p>\r\n\r\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/84-0-0-0-0-1525174139.png\" /></p>\r\n\r\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/85-0-0-0-0-1525174158.png\" /></p>\r\n\r\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\r\n\r\n<p style=\"text-align:center\">广州和德此次参展均为使用自主研发设备生产的液态模锻（挤压铸造）产品。本次莅临指导的有铁马、小康工业、华孚、福特、雷联、庆铃汽车等。</p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/storage/app/media/86.png\" /></p>\r\n\r\n<p style=\"text-align:center\"><strong>液态模锻（挤压铸造）精密成型产品</strong>&nbsp;<img src=\"/storage/app/media/87.png\" /></p>\r\n\r\n<p style=\"text-align:center\">HVSC1250</p>\r\n\r\n<p style=\"text-align:center\">HVSC系列(HVSC400、HVSC800、HVSC1250)液态模锻（挤压铸造）设备是实现先进液态模锻成型工艺的成套自动化装备。该装备适用于高强度、高力学性能、高气密性、耐磨、耐压的铝、镁合金铸件的生产。产品普遍适用于汽车、摩托、通信、航天航空、军工等行业的结构件、受力件等。</p>','<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/81-0-0-0-0-1525174080.png\"></p>\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/82-0-0-0-0-1525174096.png\"></p>\n<p style=\"text-align:center\">2018年第八届中国（重庆）汽车技术展•铝制品汽车零部件展在重庆国际博览中心于2018/3/28-30日隆重举行，国际汽车行业的知名企业和铝制汽车零部件精英聚集于此。</p>\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/83-0-0-0-0-1525174121.png\"></p>\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/84-0-0-0-0-1525174139.png\"></p>\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\n<p style=\"text-align:center\"><img src=\"/storage/app/media/cropped-images/85-0-0-0-0-1525174158.png\"></p>\n<p style=\"text-align:center\"><strong>展会现场</strong></p>\n<p style=\"text-align:center\">广州和德此次参展均为使用自主研发设备生产的液态模锻（挤压铸造）产品。本次莅临指导的有铁马、小康工业、华孚、福特、雷联、庆铃汽车等。</p>\n<p style=\"text-align:center\"><img src=\"/storage/app/media/86.png\"></p>\n<p style=\"text-align:center\"><strong>液态模锻（挤压铸造）精密成型产品</strong> <img src=\"/storage/app/media/87.png\"></p>\n<p style=\"text-align:center\">HVSC1250</p>\n<p style=\"text-align:center\">HVSC系列(HVSC400、HVSC800、HVSC1250)液态模锻（挤压铸造）设备是实现先进液态模锻成型工艺的成套自动化装备。该装备适用于高强度、高力学性能、高气密性、耐磨、耐压的铝、镁合金铸件的生产。产品普遍适用于汽车、摩托、通信、航天航空、军工等行业的结构件、受力件等。</p>','2018-04-30 19:10:00',1,'2018-05-01 03:31:38','2018-05-01 03:32:58');
